import React from "react";

function Counter()
{
    return(
        <div className="text-center display-6 border rounded-5">
            <div>1</div>
            <div className="mt-3">
                <button className="btn btn-sm btn-outline-success">Increment</button>
                <button className="btn btn-sm btn-outline-warning">Reset</button>
                <button className="btn btn-sm btn-outline-primary">Decrement</button>

            </div>
        </div>
    )
}
export default Counter;
